import React from "react";

const Button = ({setTodos, todos, inputValue}) => {
    return (
        <button onClick={(e) => {
            let obj = {
                id: todos.length,
                value: inputValue,
                isDone: false
            };

            const newTodos = todos.concat(obj)

            setTodos(newTodos)
            e.preventDefault()
        }}
        >Add</button>
    )
}

